import React from 'react';
import ReactDOM from 'react-dom';

setInterval(() => {
		ReactDOM.render(
			<div style={{
				border: "8px solid",
				borderImage: "linear-gradient(-45deg,#743ad5,#d53a9d) 1"
			}}>
				Время:<br/>
				{new Date().toLocaleTimeString()}
			</div>, document.getElementById('root')
		);
}, 1000
);
